static char _consume(lex_context& ctx)
{
    char ch = 0;
    ctx.in.get(ch);

    ctx.bytes++;
    ctx.col++;

    if (ch == '\n')
    {
        ctx.line++;
        ctx.col = 1;
    }

    return ch;
}

